import './App.css';
import Navbar from './componets/Navbar/Navbar';
import Intro from './componets/Intro/Intro';
import Services from './componets/Services/Services';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Intro/>
      <Services />
    </div>
  );
}

export default App;
